import web from "./images/chinise.jpg";
import Card from "./card";

const Service = () => {
  return (
    <>
     <Card name="food order" img={web} link="https://sahilzore-2003.github.io/RajChinese.github.io/"/>
    </>
  );
};

export default Service;
